import '../css/Footer.css';

class Header extends Component {

  constructor(props) {
    super(props);

    this.state = {
      badges: 0
    };
  }

  render() {
    return (
      <div className="footer">
        <footer>

        </footer>
      </div>
    );
  }
}

export default Header;
